import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router} from 'react-router-dom';
import Home from './components/Home/Home';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
      <Router>
        <Home></Home>
        <Footer></Footer>
      </Router>
    </div>
  );
}

export default App;
